import style from "./Form.module.css";

const Form = () => {
  return (
    <form className={style.Container}>
      <div>
        <label className={style.User} htmlFor="">
          Username:{" "}
        </label>
        <input className={style.Pass} type="text" />
      </div>
      <div>
        <label className={style.Pass} htmlFor="">
          Password:{" "}
        </label>
        <input type="text" />
      </div>
      <button></button>
    </form>
  );
};

export default Form;
